// components/hh-sdkcontext.js
Component({
  behaviors: [require('./hhBehaviors.js')],
  /**
   * 组件的属性列表
   */
  properties: {

  },

  /**
   * 组件的初始数据
   */
  data: {
    _name: 'hh-sdkcontext',
  },

  /**
   * 组件的方法列表
   */
  methods: {
    navigateTo(options) {
      if (!options || !options.page) {
        return;
      }

      switch (options.page) {
        case 'drugOrder':
          this._viewMedicine(options.drugOrderId, options.redirectPage);
          break;
        case 'drugOrderList':
          this._viewMedicineOrderList(options.redirectPage);
          break;
        case 'addressList':
          break;
        default:
          return;
      }
    },

    _requestComplete() {}
  }
})